import './App.css';
import {useState, useEffect} from "react";

function App() {

    const [people, setPeople] = useState({});

    function getPeople() {
        fetch('http://localhost:8080/fetchData')
            .then(response => {
                console.log(response, 'response returning')
                return response;
            })
            .then(data => {
                setPeople(data);
            })
    }

    useEffect(() => {
        getPeople();
    }, []);

    return (
    <div className="App">
        <p>Input Postman Collection ID</p>
        <div>
          <input/>
          <button>Test</button>
        </div>
          <div>
              <p className="current-results">Current Validation Results</p>
              <p className="previous-results">Previous Validation Results</p>
          </div>
    </div>
  );
}

export default App;
